// tabelaCars.js
import React from 'react';
import Car from '../Car';

function TabelaCars({ filterType, filterName, handleFilterTypeChange, handleFilterNameChange, carsFiltered }) {
  // Ensure that carsFiltered is defined before trying to map over it
  if (!carsFiltered || carsFiltered.length === 0) {
    return <div>No cars available</div>;
  }

  return (
    <div>
      {/* Your existing code here */}
      <table className="table table-striped">
        <thead>
          <tr>
            <th>Name</th>
            <th>Model</th>
            <th>Tip</th>
          </tr>
        </thead>
        <tbody>
          {carsFiltered.map((car, index) => (
            <Car key={index} car={car} />
          ))}
        </tbody>
      </table>
    </div>
  );
}

export default TabelaCars;
